import React, { useState , useEffect, useCallback } from 'react';
import styled from 'styled-components';
import MobileCard from '../components/MobileCard';
import {Link} from 'react-router-dom';
import { livingAbroadInfo } from '../AbroadLife';

const PageContainer = styled.div`
  width: 100%;
  max-width: 390px;
  margin: 0 auto;
  background-color: #FFFFFF;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  position: relative;
`;

const ScrollableContent = styled.div`
  flex: 1;
  overflow-y: auto;
  padding: 20px 10px;
`;

const Title = styled.h1`
  font-size: 24px;
  margin-bottom: 20px;
`;

const FilterContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 10px;
  margin-bottom: 20px;
`;

const FilterButton = styled.button`
  padding: 8px 12px;
  border: 1px solid #ddd;
  border-radius: 20px;
  background-color: ${props => props.active ? '#ffd43b' : 'white'};
  color: ${props => props.active ? 'black' : '#333'};
  font-size: 14px;
  cursor: pointer;
`;
const Divider = styled.hr`
  border: none;
  border-top: 1px solid #e0e0e0;
  margin: 15px 0;
`;

const BottomNav = styled.div`
  position: fixed;
  bottom: 0;
  left: 50%;
  transform: translateX(-50%);
  width: 100%;
  max-width: 390px;
  height: 60px;
  background-color: #ffec7e;
  display: flex;
  justify-content: space-around;
  align-items: center;
  z-index: 1000;
`;

const NavItem = styled.div`
  font-size: 24px;
`;

const MobileAbroad = () => {
    const [posts, setPosts] = useState([]);
    const [activeFilter, setActiveFilter] = useState('Ï†ÑÏ≤¥');
    const [activeSort, setActiveSort] = useState('Ïù∏Í∏∞Ïàú');
    const navigate = useNavigate();
    const countryInfo = {
      Ï†ÑÏ≤¥: { flag: 'üåç' },
      Ï∫êÎÇòÎã§: { flag: 'üá®üá¶' },
      Ìò∏Ï£º: { flag: 'üá¶üá∫' },
      Îâ¥ÏßàÎûúÎìú: { flag: 'üá≥üáø' },
      ÏòÅÍµ≠: { flag: 'üá¨üáß' },
      ÎÑ§ÎçúÎûÄÎìú: { flag: 'üá≥üá±' },
      ÎèÖÏùº: { flag: 'üá©üá™' },
    };

    useEffect(() => {
        setPosts(livingAbroadInfo);
      }, []);

    const sortPosts = useCallback((postsToSort) => {
      return [...postsToSort].sort((a, b) => {
        if (activeSort === 'Ïù∏Í∏∞Ïàú') {
          return b.likes - a.likes;
        } else {
          return new Date(b.date) - new Date(a.date);
        }
      });
    }, [activeSort]);
    const handleOpenSideBar = () => {
      navigate('/sidebar');
    };
    const filteredAndSortedPosts = useCallback(() => {
      let filtered = activeFilter === 'Ï†ÑÏ≤¥' ? posts : posts.filter(post => post.country === activeFilter);
